import React from 'react';
import ReactDOM from 'react-dom';
import WebFont from 'webfontloader';
import './index.css';
import App from './App.js';
import 'tachyons';

WebFont.load({
    google: {
        families: ['Montserrat', 'sans-serif']
    }
});

ReactDOM.render(<App />, document.getElementById('root'));
